class RecordGenerationRules {
  /**
   * @param number distanceThreshold distance in meters
   * @param number timeThreshold time in milisegundos
   * @param number speedThreshold speed in km/h
   * @param boolean useDoorStateAsTrigger
   */
  constructor(
    distanceThreshold,
    timeThreshold,
    speedThreshold,
    useDoorStateAsTrigger,
    accumulatorTimeThreshold,
    errorReporter
  ) {
    const args = Array.from(arguments);
    if (args.lenngth < 6 || args.some((arg) => arg === undefined || arg === null)) {
      errorReporter('ERROR_MISSING_ARGUMENTS');
    }
    this.distanceThreshold = distanceThreshold;
    this.timeThreshold = timeThreshold;
    this.speedThreshold = speedThreshold;
    this.useDoorStateAsTrigger = useDoorStateAsTrigger;
    this.accumulatorTimeThreshold = accumulatorTimeThreshold;
  }
}

/**
 * @returns {RecordGenerationRules}
 */
export default RecordGenerationRules;
